INSERT INTO `announcements` (`id`, `text`, `posted_by`, `posted_date`) VALUES
(15, 'Welcome to our Virtual Healthcare Neighborhood (VHN) !\n', 133, '1393093805000'),
(16, 'Continue to review the weekly educational material, use the blog site to make comments or ask questions to the other caregivers. We appreciate your participation!', 133, '1396055149000'),
(17, 'Reminder - use your SleepTracker watch starting Monday April 21st through Sunday night April 27. Let us know if you have any questions.', 133, '1398023624000'),
(18, 'Welcome to week 7! This weeks educational material covers some tips to help with daily activities. Please review the material under the Educational Material tab at the top of the screen and also review the Knowledge Check and Activity for this week. Please ask any questions you have on the blog site - thanks!', 133, '1398690527000'),
(19, 'Week 8 has begun. This week we are talking about challenging behavior. If anyone has had an experience they would like to share, what might have worked or not worked to help with situation that would be great.', 133, '1399384994000'),
(20, 'Week 9 is available. This week we are sharing information about sleep. Please take a few minutes to check out the Educational Material section at the top of the home page. This week is Month 3 week 1. Let us know if you have any questions and please add to the blog about any sleep questions, comments or concerns. We, of course, welcome any questions or things you would like to share anytime!', 133, '1400011060000'),
(21, 'Week 10 is available. We continue to provide information about the important topic of sleep. Please review the information, take the knowledge check and try out the activity.', 133, '1400706796000'),
(22, 'We are now moving into information about movement and the person with dementia. Please continue to review the weekly material and comment on the blog if you have examples or questions about the topic for discussion. ', 133, '1401490718000'),
(23, 'The week to wear the Sleeptracker is coming up! Please mark your calendars to use it next week, from Monday night June 16th through Sunday night June 22. Thank you for your continued participation.', 133, '1402497089000'),
(24, 'Start using your sleeptracker tonight - Monday June 16th for one week. The last night to use it for this month will be Sunday night June 22nd. ', 133, '1402931133000'),
(25, 'Week 14 is available. This week covers some important resources in our area. You may know about many of them and hopefully you can blog and share about some other services in your area. ', 133, '1403661885000'),
(26, 'This week and next week our topics are oral health. Please check out the information for this week under Educational Material tab. Also, we will be notifying everyone that starting on Sunday night July 20th through Saturday night August 2 we will ask you to use your sleeptracker. This will be the last period of monitoring for our study. A brief in person follow up visit will be scheduled to answer some of the questionnaires again and we will provide compensation again ($50) for your time answering our questions. Let us know if you have any questions at this time and thanks for your ongoing participation.', 133, '1404350640000'),
(27, 'We have reached our final week of educational material. Please review the 2nd week of oral health under month 4, week 4.', 133, '1405041469000');
INSERT INTO `discussion_answers` (`id`, `answer_text`, `posted_date`, `posted_by`, `question_id`) VALUES
(1, 'Thanks Mike, I know the people at ODU computer science were aware of the issue, glad you got it resolved.', '1395540891000', 133, 4),
(2, 'I know the ODU computer science folks were aware of the issue.', '1395540952000', 133, 3),
(3, 'thanks again for the opportunity to participate in the study !', '1395794320000', 158, 2),
(4, 'Your name will show up automatically', '1395859914000', 135, 5),
(5, 'Hope you find it interesting and helpful.\nChristi Fowler', '1396055224000', 133, 2),
(6, 'You can however choose whether or not to hide your user name.', '1398177076000', 146, 5),
(7, 'Administrator Response', '1398181199000', 146, 1),
(8, 'Correct.', '1398181316000', 146, 6),
(9, 'you can directly see what ever you post here', '1398361079000', 146, 8),
(10, 'There are several ways to think about finding help with in home care. First, there are private duty agencies that can provide individuals with various skill levels to help. This would most likely be out of pocket expense. There are agencies that have volunteers that can provide short periods of respite also. Finally, some participants on this blog site may have used a particular agency or person in the past and may be willing to share that information. Neighbors and friends who have been in a similar situation may also be able to make a personal recommendation - these are often the best resource. I will list a few agencies that I have dealt with in the past. I have no personal attachment to any of them, there are many more in the area also.\nElder Care at Home 757-464-4800\nAll Heart Home Health 757-961-0049\nStay at Home Personal Care 757-392-1001\nHome Instead Senior Services 757-228-3276\nAlzheimer''s Association 757-459-2405 (may have volunteers)\nSenior Services 757=461-9481 (may have volunteers)\n', '1398651444000', 133, 9),
(11, 'Thank you for the question. It is very common to wonder if you are doing enough or doing the "right" thing. Generally it is a good idea to have some type of daily activity - both physical activity and mental activity. It doesn''t have to consume a great deal of time however. At the same time, it is important to understand that as issues with dementia continue to progress you mother may be less and less interested in activities and in fact trying to do them may cause increased frustration for her. Try to vary the time of day you are planning the activity, if she is tired or overstimulated she may not be able to focus on things at that moment. If she seems more frustrated than engaged in the activity it may be time to slow down and wait for another time. Hope this helps, it is not always easy to find the balance between activity and frustration, pay attention to her expression and body language that will give you clues.', '1398652074000', 133, 10),
(12, 'Vedette, I have commented on the blog site for your questions. Please let me know if the information was helpful and thank you for your participation.', '1398652741000', 133, 11),
(13, 'Vedette, I don''t have any better advice than Christi shared.  I just want to tell you that you have lots of company, feeling the uncertainty that you do; wondering if you should be pushing your mother a little more or a little less.  I felt exactly the same with my mother-in-law, who also had dementia.  In the last weeks of her life it was a war of wills just to try to get her to (a war I''m sometimes ashamed I fought at all).  Now with my father-in-law (99, deaf, failing eyesight, and diminishing cognitive function, though not actual dementia) it''s the same kind of struggle.  I''m just trying to remember it''s not about conforming him to my "normal", but my conforming to his.  Years ago I read, "We raise our children, but we lower our parents, however gently."  Your mother is blessed to have you.  No one is ever a perfect parent, yet children continue to grow and function in society.  We don''t "parent" our parents perfectly either, but as long as they can perceive affection in our faces and voices, we are providing an environment that meets their needs as people of immeasurable value.  Take each day, each hour, as you best can.  And by the way, my mother-in-law ended up enjoying children''s books.  Even when the storyline was too much for her, the illustrations engaged her.  Perhaps your mother would enjoy the same.', '1398734786000', 162, 10),
(14, 'Sorry!  That should read "a war of wills just to try to get her to eat".', '1398734914000', 162, 10),
(15, 'Thanks for the comments Betty, very well said. We will never get anything perfect (that''s my least favorite work by the way), you both need to hear that you are doing a great job!\nChristi', '1398893411000', 133, 10),
(16, 'As we have reviewed in some of the educational material, routine does help. At the same time, worsening issues with memory are associated with advancing dementia. He will still have good days and not so good days, so the issues may show up for a day or two then get a little better. He may be getting to a point where he needs more supervision from time to time. Do any of the other participants have a similar experience?', '1399297389000', 133, 12),
(17, 'We recognized and acknowledged my mother''s dementia at this stage of infrequent forgetfulness.  Fortunately, she was able to tell me she needed help and did not want to live alone any longer.  Prior to this she was invincible and independent.  About 4 years ago, she would forget the simple things and was guided easily with little reminders or pointing it out. We asked the doctor and they prescribed medication and we have seen a slow and steady decline in her cognitive ability almost immediately.  I often wonder what life would be like had we not given her any medications for the dementia.  Now she has to have complete verbal direction for all daily practices.  She is physically able to complete a task but just cannot think to do it or how to do it on her own.  For example, I used to remind her to brush her teeth and now I hand her the toothbrush.  She has lost many words has a lot of difficulty expressing her needs.  One big challenge to me is anticipating her needs.  It is quite the challenge! I am glad I know her very well.  I was the baby so we are very close.  Today, she did not recognize me.', '1399407002000', 169, 12),
(18, 'Thank you both!!  I am so grateful for the support!  Sometimes I just want to cry but there is not enough time in the day!  I did not even think about the books!!  I get so wrapped up in the tasks at hand I forget the simple things.  I cannot thank you enough Betty! I needed your message today.  Thank you!!', '1399407437000', 169, 10),
(19, 'My mom is reading "The Very Hungry Caterpillar" to my three year old!  This is a great moment!  ', '1399408221000', 169, 10),
(20, 'Vedette, sounds like you have learned some good ways to cope with behavior issues. I can only imagine the challenges you face each day "sandwiched" between the generations. Do you have some time each week to get out for yourself? ', '1399413796000', 133, 13),
(21, 'Not really.  No worries.  I am okay.  ', '1399483234000', 169, 13),
(22, 'What a good memory to make!', '1399586553000', 133, 10),
(23, 'I think the best idea, which is what I was thinking of while reading most of your post - you had the idea too - was limiting the amount of fluid in the evening and stopping intake at a certain point. You are certainly thinking about all the options and consequences. Having her closer to the toilet if that can be done safely is another good idea. Maybe you have already thought or tried this but using an adult brief or pad at night might take the pressure off struggling to stay dry at night. It''s not something you want to do too soon, if you can make adjustments and not need these items that''s best. I appreciate your sharing this topic Vedette, many do experience this issue sooner or later, it''s good to discuss ideas ahead of time. ', '1399586894000', 133, 14),
(24, 'Thanks again for sharing Vedette.', '1399587009000', 133, 12),
(25, 'Two nights in a row and no wandering!  Yeah!!', '1400174754000', 169, 16),
(26, 'Sounds like you have had some significant issues with sleeping arrangements. Again you have thought of some great ways to cope with some of the wandering concerns. As you probably know, she may be at a place with her dementia that she doesn''t really remember who your husband is - this can be very difficult for everyone. ', '1400451376000', 133, 15),
(27, 'I''m glad you can appreciate the "little" victories. I bet a couple of good nights sleep did you some good.', '1400451467000', 133, 16),
(28, 'That is a common occurrence, and usually not a problem. Too much sleep during the day can disrupt sleep at night. At times individuals with memory problems get their day and night mixed up. Keeping a set schedule, opening blinds and curtains in the morning, turning lights out at night, etc, can help keep people on the right track. ', '1401490288000', 133, 17),
(29, 'Thanks so much for sharing Vedette! The service is a great one. We see sometimes on the news that a person with dementia is missing and it is heartbreaking. Even when they are found safe and sound I can''t imagine the worry families go through. ', '1402496946000', 133, 18),
(30, 'Sorry. I logged out and  back in and found the oral health information at Month 4/week 3.  Thank you!', '1404353239000', 169, 20),
(31, 'This is Great information!  I really appreciated the video to assist with brushing.  Very useful!  Thanks Christine!', '1404395380000', 169, 20),
(32, 'No problem Vedette, glad you find it helpful.', '1404568599000', 133, 20),
(33, 'Great suggestion Mike, keeping active physically and mentally is very helpful. I''m sure the concerts cover both areas of activity!', '1405039866000', 133, 21);
