INSERT INTO `discussion_questions` (`id`, `question_text`, `poster_id`, `posted_date`, `private`, `ask_professional`, `category`) VALUES
(1, 'Ms. Fowler,\nI have not been able to record sleep on the watch. I have called yesterday and sent email to sleeptracker this morning. Will let you know what they say, if you can help please email me, will be out this morning.  Karen J', 161, '1393339149000', 1, 0, 0000000000),
(2, 'Welcome to the VHN blog. Please feel free to post questions or comments for other caregivers or the study researchers. I would like to comment that I have already learned so much from all the caregivers, there are some common things of course, but every situation is unique. Thank you for participating.\nChristi Fowler ', 133, '1395000701000', 0, 0, 0000000000),
(3, 'Tried to contact under "contact us" on 3/18/2014, with no response. Need registration information.  ', 182, '1395218597000', 1, 0, 0000000000),
(4, 'I figured it out and put the e-mail address to log in.', 182, '1395322613000', 1, 0, 0000000000),
(5, 'In blogging do we use our names? ', 161, '1395547823000', 0, 0, 0000000000),
(6, 'Names will show up as you blog, no other information is available. If you have a question for the researchers that you may not want to share with the group, "click" the private spot below. Thanks for participating!', 133, '1395775020000', 0, 0, 0000000000),
(7, 'Please feel free to ask questions or make comments about your caregiving experience. Christi', 133, '1396055051000', 0, 0, 0000000000),
(8, 'Users can now choose to anonymously comment by clicking on "Hide Username" link under the submit button.', 146, '1397174437000', 0, 0, 0000000000),
(9, 'Where do I go for in-home care on periodic basis?\n', 166, '1398088584000', 0, 0, 0000000000),
(10, 'My mother is 82 with dementia and hearing loss.  She is increasingly detaching socially and I am constantly looking for new ways to keep her busy despite her lack of interest.  Should I worry that she just sits too long and stares out the window?  I worry I am not doing enough. She gets irritated with me when I ask her to participate in games and activities.  Does it help to keep pushing her?  Thoughts?  Thanks, Vedette', 169, '1398173079000', 0, 0, 0000000000),
(11, 'Is anyone participating in this blog?  Am I missing a blog with activity?  Please advise.  Thank you.', 169, '1398336378000', 1, 0, 0000000000),
(12, 'Good Morning.  My father is 89 and  so far his dementia is manageable.  Sometimes he forgets how to use his seatbelt or where to find his orange juice.  is this a sign that the disease is progressing or a temporary moment of memory loss?  It happens just often enough and I am concerned.  Thank you.', 166, '1399292036000', 0, 0, 0000000000),
(13, 'I am raising two boys, 3 and 6 in the same household with my aging mother.  My challenge is to keep her from "mothering" the boys while teaching the boys love and respect for their elders.  I think I have bitten off more than I can chew.  Much of the time I have to keep them separated because my mother becomes agitated with the energetic play.  I dislike doing that but she gets so mad sometimes when they run and play.  I do a lot of things to distract my mother.  When we get home from school and after homework, I send her to fold laundry so the boys can run around and be crazy.  Oh and I take out her hearing aids.  Good times!', 169, '1399409132000', 0, 0, 0000000000),
(14, 'My mother is starting to urinate on floor in the middle of the night.  We have been brainstorming on possible solutions.  There are pros and cons to everything.  First, we thought it time to put a 3-1 potty next to her bed but decided it would only become an obstacle and not be used.  Another idea was to cover the carpet with plastic backed washable rugs.  Another tripping hazard.  Moving her bed to make the toilet within view was considered.  There are many options but I am still not sure what is best for her.  Last night I stopped liquid at 7 p.m. and then only a little water with her 8 p.m. medications.  Then at 10 pm I got her up to use the toilet.  This morning we were clean and I do not think she got up in the night.  Any other ideas?', 169, '1399575470000', 0, 0, 0000000000),
(15, 'My mom wanders in the middle of the night.  The first time it happened she was standing at my husbands bedside and was very upset.  She was agitated about his presence in the bed with her daughter.  Needless to say, we had to come up with a way to keep her safe and out of our bedrooms.  We have no idea what she is capable of and I live in fear.  She was never an aggressive person but the dementia has turned her into someone else.  Fortunately, the layout of our house enabled me to set up alarms when she starts wondering.  A few months ago I began to lock her door to the hallway and our bedrooms.  She has another exit through her bath to a sitting room.  I hang bells on the door before I go to bed to alert me if she wanders.  The doctor prescribed anxiety meds. and suggested melatonin.  It is a double edge sword because of the incontinence issue we recently encountered.  Sleep is constantly interrupted and it is of the utmost importance to maintain a peaceful night for my family.  There are many solutions and I really like the idea of getting someone to give me a break.  Unfortunately, cost is an issue for our family.  I have many things to consider in the next few months.  ', 169, '1400018911000', 0, 0, 0000000000),
(16, 'My mother had difficulty sleeping again last night.  She kept saying she had to put the kids to bed.  I told her a couple of times the kids were safely tucked in.  Finally, I gave her a Raggedy Ann doll to keep and care for while she slept.  The wandering stopped and she slept for the rest of the night.  These small victories keep me going!', 169, '1400080713000', 0, 0, 0000000000),
(17, 'My husband is sleeping more during the day that he did in the past.', 183, '1401481218000', 0, 0, 0000000000),
(18, 'Several months ago I was concerned about my mother''s wandering.  A friend advised me the Norfolk Sheriff''s department provides a free service called Project Lifesaver.  They install a GPS devise on wrist or ankle.  I cannot tell you how wonderful a service this is and it is FREE!  They change the batteries for you and if the recipient wanders they are easily located if they are still wearing the devise.  My mother has hers placed on her ankle.  We have not needed to locate her but I have piece of mind if she does walk away.  Project Lifesaver #328-2485.', 169, '1402442710000', 0, 0, 0000000000),
(19, 'Check out the sleep diary attachment. Use this to keep a diary of your sleep. Let us know what you think of the diary and if you learned anything about your sleep while using it.', 133, '1402935051000', 0, 0, 0000000000),
(20, 'What month/week is the oral health information?  ', 169, '1404353053000', 0, 0, 0000000000),
(21, 'Help keep active.\nWe like to go to the free concerts here in Newport News and surrounding areas. On Wednesday Port Warwick has one, Thursday Mariners Museum and Yorktown beach and Friday at City Center. There are more, but these are the ones we try to attend.', 182, '1404582108000', 0, 0, 0000000000);
